import React from "react";

import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import MainHome from "./MainHome";
// import fRegistration from "./Registration";
import MainNavbar from "./MainNavbar";
import ShowCompany from "./ShowCompany";
import ShowStudent from "./ShowStudent";
import Category from "./Category";

function App() {
  return (
    <Router>
      <div className="">
        <MainNavbar />
        {/* <div className="jumbotron" style={{ marginBottom: 0 + "px" }}></div> */}

        <Switch>
          <Route exact path={"/admin/Home"} component={MainHome} />
          {/* <Route path={"/vendor/fsignup"} component={fRegistration} /> */}
          <Route exact path={"/admin/category"} component={Category} />
          <Route path={"/admin/ShowCitizen"} component={ShowCompany} />
          <Route path={"/admin/ShowDepartment"} component={ShowStudent} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
